 */
const AM = 'am';

const moduleA = {
    namespaced: true,
    state: {
        a: 2,
    },
    mutations: {
        [AM](state) {
            state.a++;
        },
    },
    actions: {
        am(context) {
            setTimeout(() => {
                context.commit(AM);
                console.log('moduleA a:', context.state.a);
            }, 1000);
        },
    },
